import ParkourEdge from "./ParkourEdge/ParkourEdge";
import PacMan from "./PacMan/PacMan";
import WiseUp from "./WiseUp/WiseUp";
import MoodToDo from "./MoodToDo/MoodToDo";

const projects = [
    CodeT,
    ReCOVER,
    ProEvento,
    FakeNewsClassifier,
